import React from 'react';

class Navbar extends React.Component {
	render() {
		return (
			<nav class="menu">
			  <ul>
			    <li><a href="#">Home</a></li>
			    <li><a href="#">About</a></li>
			    <li><a href="#">Contact</a></li>
			  </ul>
			</nav>
		)
	}
}

export default Navbar;
